import React from 'react';
import Subjects from './Subjects'

export default function SubjectsTagsGroupsSidebar({
subjects,
setter_subjects,
selected_categories,
setter_selected_categories,
setter_selected_note,
setter_show_note_user
}) {
  return (<div  className="flex-1 border-r p-4 overflow-auto bg-white">
    <Subjects
        subjects={subjects}
        setter_subjects={setter_subjects}
        selected_categories={selected_categories}
        setter_selected_categories={setter_selected_categories}
        setter_selected_note={setter_selected_note}
        setSelectedNote={setter_selected_note}
        setter_show_note_user={setter_show_note_user}
      />
   {/*<Tags/>*/}
{/*<Groups/>*/}
  </div>)
};
